import React from "react";
import { useNavigate } from "react-router-dom";
import "./SideUser.css";

const UserProfile = () => {
  const navigate = useNavigate();
  function handleClick() {
    navigate("/UserProfile");
  }

  return (
    <div className="framme-2">
      <div className="side-user">
        <div className="user-bild"></div>
        <div className="user-info">
          <h1>Lorem ipsum dolor sit amet.</h1>
          <h2>Delantero</h2>
        </div>
        <div className="user-description">
          <p>
            Lorem ipsum dolor, sit amet consectetur adipisicing elit. Tenetur
            consectetur aut optio atque, quo vel assumenda odit unde tempore
            accusamus facere sed consequuntur ea magni ad neque dolores?
            Laboriosam eum officiis dignissimos exercitationem sapiente,
            doloribus animi ipsum saepe totam voluptates!
          </p>
        </div>
        <div>
          <button className="Profile-button" onClick={handleClick}>
            Profile
          </button>
        </div>
      </div>
    </div>
  );
};

export default UserProfile;
